text:
The #Kunming #COP15 conference offers an opportunity for taking the next big step forward for global nature protection after Nagoya. And several events augur well for it.
@ErikSolheim @UNBiodiversity
https://t.co/oFrCFG8rlJ

Today is #WorldHealthDay.
@WHO calls for building a fairer, healthier world, but the distribution of #COVID19 #vaccines is not fair at all: 75% of available vaccines have gone to a dozen rich countries while 100 poor countries received none.
https://t.co/eTjqMQzm3P

In the short term, the US and China should help control the #COVID19 pandemic by working with all nations to produce, distribute and administer vaccines. In the mid term, they should think about ways to fight poverty.
@christangucla
https://t.co/jTDAk4OQWF https://t.co/9ekO5MthAo

