text:
The US should stop the trade war against China to allow both sides to reset their priorities and address global problems with cooperative efforts, so that they can transform their current antagonistic confrontation into a win-win partnership
@christangucla
https://t.co/jTDAk4OQWF https://t.co/zlybNZMF5s

.@JoeBiden's first 100 days in office will end soon and top Chinese and US officials are to meet in Anchorage. The China-US relationship is symbiotic and deep rooted, so aiming for a "draw" in the competitive game may be the wisest strategy.
@christangucla
https://t.co/jTDAk4OQWF

