Today is #WorldFoodDay and 75th anniversary of @FAO
@FAO Director-General Qu Dongyu @FAODG reiterates its mission to help the world end hunger. The #COVID19 made it clear that “our mission is as relevant today as when our founders created the FAO in 1945”.
https://t.co/GwrG319Q5S

#China can be a leader in building a sustainable global economy, with its ecological civilization goals embracing the source of our sustenance. But all countries must work together, using nature-based solutions for recovery.
@Akanksha_Khatri @JustinCMAdams
https://t.co/dkv0I2eJ2e https://t.co/BKPXuILosn

