text:
The global governance system fell behind global realities long before the #COVID19 outbreak and the crisis offers a good opportunity for countries to work together to innovate it - by actively taking multilateral cooperation, not leaving from it.
@CCG_org
https://t.co/teDNiV4KRK https://t.co/TE8xr7QDpG

After 75 years, the @UN is now stuck in a difficult situation from which it is hard to reform the organization. This deadlock has compromised its ability to deal with 21st-century challenges, in turn undermining its authority.
@CCG_org
https://t.co/teDNiV4KRK https://t.co/zJaWUMm5ao

As last! The US is officially leaving the WHO.
@WHO, the @UN public health agency that should have been the core coordinator of global efforts to fight #COVID19, has become a scapegoat on which to pin blame for the crisis, said Wang Huiyao from @CCG_org.
https://t.co/teDNiV4KRK https://t.co/ABefyNZsWS

The US-China relationship is a cooperative rivalry where a successful strategy requires equal attention to both aspects. Such a future requires good contextual intelligence, careful management of the competition and no major miscalculations.
@Joe_Nye
https://t.co/8ffM8CNTDN https://t.co/veyqLXRfdG

