text:
On transnational issues such as #COVID19, power is a positive-sum game: It's not enough to think of POWER OVER OTHERS. We must also think how to accomplish joint goals that involve POWER WITH OTHERS. The current US strategy fails to realize this.
@Joe_Nye
https://t.co/8ffM8CNTDN https://t.co/87eEQtRWx2

Our current age - the Digital Age - is the 7th after Paleolithic, Neolithic, Equestrian, Classical, Ocean and Industrial, writes @JeffDSachs in The Ages of Globalization. The transitions from one age to the next often come with conflicts.
@CGCBeijing
https://t.co/Yms1ryrr71 https://t.co/A3zRqn9pFX

